import * as React from 'react'
import About from './About.js'
import { Navbar } from 'react-bootstrap';


function Main()
{
    return (
        <>
            <Navbar bg = "dark" variant = "dark">
                <Navbar.Brand>
                    "Chris bumb"
                </Navbar.Brand>
            </Navbar>
           <About/>
       </>
    );
}

export default Main
